
drop table ACTWEB.RADIOS;
drop sequence ACTWEB.RADIOS_ID;

CREATE TABLE ACTWEB.RADIOS (	
  RAD_ID_RAD        NUMBER              NOT NULL, -- Identificador do rádio
  SIT_ID_SIT        NUMBER              NOT NULL, -- Identificador da situação
  COR_ID_COR        NUMBER              NOT NULL, -- Identificador do corredor
  TIP_ID_TIP        NUMBER              NOT NULL, -- identificador do tipo da locomotiva
  RAD_ATUALIZACAO   DATE                NOT NULL, -- Data de criação/atualização
  RAD_CONSIDERA_SN  VARCHAR2(1 BYTE)    NOT NULL, -- Flag considera [ S = Sim | N = Não ]
  RAD_LOCO          NUMBER              NOT NULL, -- Locomotiva
  RAD_RADIO_ID      NUMBER              NULL,			-- Identificador do rádio
  RAD_MODELO_AC     VARCHAR2(10 BYTE)   NULL,  		-- Modelo do rádio de cima
  RAD_SERIAL_AC     VARCHAR2(16 BYTE)   NULL,			-- Serial do rádio de cima
  RAD_MODELO_AB     VARCHAR2(10 BYTE)   NULL,			-- Modelo do rádio de baixo
  RAD_SERIAL_AB     VARCHAR2(16 BYTE)   NULL, 		-- Serial do rádio de baixo
  RAD_ATIVO_SN      VARCHAR2(1 BYTE)    NOT NULL);-- Flag registro [ S = Sim | N = Não ]

ALTER TABLE ACTWEB.RADIOS ADD ( CONSTRAINT PK_RADIOS PRIMARY KEY (RAD_ID_RAD));

CREATE SEQUENCE ACTWEB.RADIOS_ID
  START WITH 1
  MAXVALUE 999999999999999999999999999
  MINVALUE 1
  NOCYCLE
  CACHE 20
  NOORDER;
  
